COPY events (id, created_at, updated_at, venue_id, event_status_id, category_id, series_id, name, slug, description, trailer_video_url, is_active, is_free_event, terms_and_conditions, view_count, order_count, user_id, min_price, max_price) FROM stdin;
22	2016-07-22 21:22:49	2016-09-19 11:06:47	11	1	4	5	Last Night of the Proms - 7 September 2013	last-night-of-the-proms-7-september-2013	<p>Bringing to an end this years season of worlds greatest classical music festival, which started on 12 July, the Last Night once again brought together many of the traditions that have made it one of the most instantly recognisable events in live music and was described in The Independent as the best in years.<br></p>	<p>tixmall.com</p>	t	t	<p>Tickets for the worlds greatest classical music festival got snapped up fast when they went on sale in May, with tickets for several Proms concerts selling out soon after bookings opened.\n\nHowever, if you missed out on tickets then dont let the Tickets not available buttons next to the events on our website put you off  theres still hope..! There are three ways you could still get to your Prom  Day Promming, extra tickets and Fifth seats.<br></p>	6	0	0	0	0
18	2016-07-22 21:16:38	2016-09-19 12:00:49	11	1	4	4	STORY OF THE PROMS TOUR	story-of-the-proms-tour	<p>Which pianist played a Prom 27 years after his death? How did an audience member save Andr Previns Carmina Burana? And just what is the most performed piece of music at the Proms?\n\nThe answers to these questions and more are revealed in this unique tour about the worlds most celebrated classical music festival.\n\nAll tours last an hour and are conducted in English.\n\nBook at the best price: it is cheaper to buy your ticket online than in person or over the telephone.<br></p>	<p>tixmall.com</p>	t	t	<p>Tickets for the worlds greatest classical music festival got snapped up fast when they went on sale in May, with tickets for several Proms concerts selling out soon after bookings opened.\n\nHowever, if you missed out on tickets then dont let the Tickets not available buttons next to the events on our website put you off  theres still hope..! There are three ways you could still get to your Prom  Day Promming, extra tickets and Fifth seats.<br></p>	15	0	0	0	0
7	2016-07-22 20:45:43	2016-09-20 11:40:29	11	1	4	3	MRS ARMITAGE AND THE BIG WAVE	mrs-armitage-and-the-big-wave	<p>As part of the Royal Albert Halls inaugural Festival of Film, Gaga Theatre Company presents an adaptation of Mrs Armitage &amp; The Big Wave, Quentin Blakes funny and touching book about friendship, helping others, and how to stay positive and keep going.\nMrs Armitage and her faithful dog Breakspear want to paddle out to sea to wait for the Big Wave, but Mrs Armitage isnt satisfied with her ordinary surfboard. On her trips across the ocean to fetch gadgets, contraptions and enhancements for her board, Mrs Armitage comes across a little girl who needs her help<br></p>	<p>tixmall.com</p>	t	t	<p>Tickets cannot be offered for sale from within the Royal Albert Hall except from the Box Office by our ticketing team.\n\nRefunds and exchanges will only be offered in the event of cancellation or rescheduling. Refund or exchange must be requested from your point of purchase and can only be claimed by the person who made the booking. Refund will only cover the face value of the tickets and any associated booking fees.\n\nOnly tickets purchased by the Box Office or approved agents are valid for admission. Tickets sold via third parties and other unauthorised outlets, including online auction sites, are not valid for admission. Reselling a ticket makes it void and the ticketholder may be refused entry.<br></p>	32	0	0	0	0
